document.addEventListener("keyup", function(event) {
  if (event.keyCode == 13) {
    var search = document.getElementById("search").value.toLowerCase();
    for (var i = 0; i < mdlength; i++) {
      if (markerdata[i][0].toLowerCase().includes(search)) {
        map.flyTo({center: [markerdata[i][4], markerdata[i][5]], essential: true});
        (markers[i]).togglePopup();
        if (markerdata[i][3] == "G") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a green grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "Y") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a yellow grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "R") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a red grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        break
      }
      else if (markerdata[i][1].toLowerCase().includes(search)) {
        map.flyTo({center: [markerdata[i][4], markerdata[i][5]], essential: true});
        (markers[i]).togglePopup();
        if (markerdata[i][3] == "G") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a green grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "Y") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a yellow grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "R") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a red grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        break
      }
    }
  }
});

map.on('click', function(click) {
  lat = click.lngLat.lat;
  long = click.lngLat.lng
  console.log(long, lat)

  for (var i = 0; i < mdlength; i++) {
    if (long > (markerdata[i][4] - 0.0004) && long < (markerdata[i][4] + 0.0004)) {
      if (lat > (markerdata[i][5] - 0.0004) && lat < markerdata[i][5] + 0.0004) {
        if (markerdata[i][3] == "G") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a green grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "Y") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a yellow grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
        else if (markerdata[i][3] == "R") {
          document.getElementById("violation-info").innerHTML = markerdata[i][0] + " at " + markerdata[i][1] + " received a red grade from the Alameda County Health Department. The health inspector wrote: " + markerdata[i][2];
        }
      }
    }
  }
});